import home from './resources/home.png';;
import math from './resources/math.png';
import science from './resources/science.png';
import accomplishments from './resources/accomplishments.png';
import React from 'react';
import "./Header.css";
class Icon extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div>
                <img class="Image" src={this.props.name}></img>
            </div>
        )
    }
}
class Header extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div className="Header">
                <Icon name="home"></Icon>
                <Icon name="math"></Icon>
                <Icon name="science"></Icon>
                <Icon name="accomplishments"></Icon>
            </div>
        )
    }
}
export default Header;
